INSERT INTO `redcap_crons` VALUES (1,'PubMed','Query the PubMed API to find publications associated with PIs in REDCap, and store publication attributes and PI/project info. Emails will then be sent to any PIs that have been found to have publications in PubMed, and (if applicable) will be asked to associate their publication to a REDCap project.','DISABLED',86400,7200,1,0,NULL,NULL,0,NULL),(2,'RemoveTempAndDeletedFiles','Delete all files from the REDCap temp directory, and delete all edoc and Send-It files marked for deletion.','ENABLED',120,600,1,0,NULL,NULL,0,NULL),(3,'ExpireSurveys','For any surveys where an expiration timestamp is set, if the timestamp <= NOW, then make the survey inactive.','ENABLED',120,600,1,0,NULL,NULL,0,NULL),(4,'SurveyInvitationEmailer','Mailer that sends any survey invitations that have been scheduled.','ENABLED',60,1800,5,0,NULL,NULL,0,NULL),(5,'DeleteProjects','Delete all projects that are scheduled for permanent deletion','ENABLED',300,1200,1,0,NULL,NULL,0,NULL),(6,'ClearIPCache','Clear all IP addresses older than X minutes from the redcap_ip_cache table.','ENABLED',180,60,1,0,NULL,NULL,0,NULL),(7,'ExpireUsers','For any users whose expiration timestamp is set, if the timestamp <= NOW, then suspend the user\'s account and set expiration time back to NULL.','ENABLED',120,600,1,0,NULL,NULL,0,NULL),(8,'WarnUsersAccountExpiration','For any users whose expiration timestamp is set, if the expiration time is less than X days from now, then email the user to warn them of their impending account expiration.','ENABLED',86400,600,1,0,NULL,NULL,0,NULL),(9,'SuspendInactiveUsers','For any users whose last login time exceeds the defined max days of inactivity, auto-suspend their account (if setting enabled).','ENABLED',86400,600,1,0,NULL,NULL,0,NULL),(10,'ReminderUserAccessDashboard','At a regular interval, email all users to remind them to visit the User Access Dashboard page. Enables the ReminderUserAccessDashboardEmail cron job.','ENABLED',86400,600,1,0,NULL,NULL,0,NULL),(11,'ReminderUserAccessDashboardEmail','Email all users in batches to remind them to visit the User Access Dashboard page. Will disable itself when done.','DISABLED',60,1800,5,0,NULL,NULL,0,NULL),(12,'DDPQueueRecordsAllProjects','Queue records that are ready to be fetched from the external source system via the DDP service.','ENABLED',300,600,1,0,NULL,NULL,0,NULL),(13,'DDPFetchRecordsAllProjects','Fetch data from the external source system for records already queued by the DDP service.','ENABLED',60,1800,10,0,NULL,NULL,0,NULL),(14,'PurgeCronHistory','Purges all rows from the crons history table that are older than one week.','ENABLED',86400,600,1,0,NULL,NULL,0,NULL),(15,'UpdateUserPasswordAlgo','Send email to all Table-based users telling them to log in for the purpose of upgrading their password security (one time only)','DISABLED',86400,7200,1,0,NULL,NULL,0,NULL),(16,'AutomatedSurveyInvitationsDatediffChecker','Check all conditional logic in Automated Surveys Invitations that uses \"today\" inside datediff() function','ENABLED',43200,7200,1,0,NULL,NULL,0,NULL);
