sts of 10 items that measure a person\'s daily functioning specifically the activities of daily living and mobility. The items include feeding, moving from wheelchair to bed and return, grooming, transferring to and from a toilet, bathing, walking on level surface, going up and down stairs, dressing, continence of bowels and bladder. <br><br>How is the Barthel Index used? <br><br>The assessment can be used to determine a baseline level of functioning and can be used to monitor improvement in activities of daily living over time. The items are weighted according to a scheme developed by the authors. The person receives a score based on whether they have received help while doing the task. The scores for each of the items are summed to create a total score. The higher the score the more \"independent\" the person. Independence means that the person needs no assistance at any part of the task. If a persons does about 50% independently then the \"middle\" score would apply. ','radio','Feeding','0, 0 = unable \\n 5, 5 = needs help cutting, spreading butter, etc., or requires modified diet \\n 10, 10 = independent',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL),(13,'barthel_10',NULL,'barthel_index',NULL,15,NULL,NULL,'radio','Stairs','0, 0 = unable \\n 5, 5 = needs help (verbal, physical, carrying aid) \\n 10, 10 = independent',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL),(13,'barthel_2',NULL,'barthel_index',NULL,6,NULL,NULL,'radio','Bathing','0, 0 = dependent \\n 5, 5 = independent (or in shower)',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL),(13,'barthel_3',NULL,'barthel_index',NULL,7,NULL,NULL,'radio','Grooming','0, 0 = needs to help with personal care \\n5, 5 = independent face/hair/teeth/shaving (implements provided)',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL),(13,'barthel_4',NULL,'barthel_index',NULL,9,NULL,NULL,'radio','Dressing','0, 0 = dependent \\n 5, 5 = needs help but can do 