INSERT INTO `redcap_metadata_archive` VALUES (13,'address',NULL,'registration_form',NULL,20,NULL,NULL,'textarea','Address',NULL,'Address for contact',NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_1',NULL,'barthel_index','Barthel Index',4,NULL,'What is the Barthel Index? <br><br>The Barthel Index consists of 10 items that measure a person\'s daily functioning specifically the activities of daily living and mobility. The items include feeding, moving from wheelchair to bed and return, grooming, transferring to and from a toilet, bathing, walking on level surface, going up and down stairs, dressing, continence of bowels and bladder. <br><br>How is the Barthel Index used? <br><br>The assessment can be used to determine a baseline level of functioning and can be used to monitor improvement in activities of daily living over time. The items are weighted according to a scheme developed by the authors. The person receives a score based on whether they have received help while doing the task. The scores for each of the items are summed to create a total score. The higher the score the more \"independent\" the person. Independence means that the person needs no assistance at any part of the task. If a persons does about 50% independently then the \"middle\" score would apply. ','radio','Feeding','0, 0 = unable \\n 5, 5 = needs help cutting, spreading butter, etc., or requires modified diet \\n 10, 10 = independent',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_10',NULL,'barthel_index',NULL,15,NULL,NULL,'radio','Stairs','0, 0 = unable \\n 5, 5 = needs help (verbal, physical, carrying aid) \\n 10, 10 = independent',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_2',NULL,'barthel_index',NULL,6,NULL,NULL,'radio','Bathing','0, 0 = dependent \\n 5, 5 = independent (or in shower)',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_3',NULL,'barthel_index',NULL,7,NULL,NULL,'radio','Grooming','0, 0 = needs to help with personal care \\n5, 5 = independent face/hair/teeth/shaving (implements provided)',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_4',NULL,'barthel_index',NULL,9,NULL,NULL,'radio','Dressing','0, 0 = dependent \\n 5, 5 = needs help but can do about half unaided \\n 10, 10 = independent (including buttons, zips, laces, etc.)',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_5',NULL,'barthel_index',NULL,10,NULL,NULL,'radio','Bowels','0,0 = incontinent (or needs to be given enemas) \\n 5, 5 = occasional accident \\n 10, 10 = continent',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_6',NULL,'barthel_index',NULL,11,NULL,NULL,'radio','Bladder','0, 0 = incontinent, or catheterized and unable to manage alone \\n 5, 5 = occasional accident \\n 10, 10 = continent',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_7',NULL,'barthel_index',NULL,12,NULL,NULL,'radio','Toilet Use','0, 0 = dependent \\n 5,5 = needs some help, but can do something alone \\n 10, 10 = independent (on and off, dressing, wiping)',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_8',NULL,'barthel_index',NULL,13,NULL,NULL,'radio','Transfers (bed to chair and back)','0, 0 = unable, no sitting balance \\n 5, 5 = major help (one or two people, physical), can sit \\n 10, 10 = minor help (verbal or physical) \\n 15, 15 = independent',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL,NULL,NULL,0,NULL,1),(13,'barthel_9',NULL,'barthel_index',NULL,14,NULL,NULL,'radio','Mobility (on level surface)','0, 0 = immobile or < 50 yards \\n 5, 5 = wheelchair independent, including corners, > 50 yards \\n 10, 10 = walks with help of one person (verbal or physical) > 50 yards \\n 15, 15 = independent (but may use any aid; for example, stick) > 50 yards',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0,NULL,NULL